import { Form, Formik } from 'formik'
import React from 'react'
import { createUsersRequest } from '../api/createRecep.api';
import Layout from '../components/Layout';

type FormikProps={
    gmail:string;
    password:string;
}

function FormuLogin() {
  return (
    <div>
        <Formik 
        initialValues={{
            gmail: '',
            password:'',
        }}
        onSubmit={async(values:FormikProps)=>{
            console.log(values);
            try{
                const response = await createUsersRequest(values)
            } catch (error){
                console
            }



        }}
        >
            {({handleChange, handleSubmit})=>(

            <Form onSubmit={handleSubmit}>


            <label>Gmail</label>
            <input type="text" name='gmail'placeholder='gmail' onChange={handleChange}/>

            <label>password</label>
            <textarea name='password' rows={3} placeholder= 'password' onChange={handleChange}></textarea>
            <button type='submit'> save</button>


            </Form>
            )}
        </Formik>
        <Layout />
    </div>
  )
}

export default FormuLogin
